import React from 'react';
import { Link } from 'react-router-dom';

function Header() {
  return (
    <header className="Header">
      <h1>게시판</h1>
      <nav className="Menu">
        <ul>
          <li>
            <Link to="/">홈</Link>
          </li>
          <li>
            <Link to="/about">소개</Link>
          </li>
          <li>
            <Link to="/contact">연락</Link>
          </li>
        </ul>
      </nav>
    </header>
  );
}

export default Header;
